INSERT INTO `Giudizio`(`idUtente`, `idFilm`, `commento`, `punteggio`, `titolo`, `datapubblicazione`) VALUES
(15, 13, 'Film molto divertente! Da vedere e rivedere', '9.0', 'Gran bella commedia', '2020-06-13'),
(13, 13, 'Il film non mi  piaciuto per niente!', '2.0', 'Pessimo', '2020-06-13'),
(19, 13, 'Film nella media... Nulla di speciale devo dire', '6.0', 'Sciapo', '2020-06-13'),
(3, 13, 'Will Smith non mi delude mai commedia molto divertente e regia degna di nota.', '8.5', 'WOW', '2020-06-13'),
(11, 1, 'Un classico, sono contento che il cinema l''abbia riproposto.', '10.0', 'Una garanzia', '2020-06-13'),
(9, 1, 'Un film da vedere e rivedere 1000 volte Jim Caviezel fenomenale!', '9.0', 'Da vedere fino alla morte', '2020-06-13'),
(7, 1, 'Pochi film nuovi... la soluzione  riproporre alcuni evergreen degni di nota. Concordo in pieno', '9.2', 'Niente da dire', '2020-06-13'),
(4, 1, 'Un bel film per l''epoca, forse al giorno d''oggi ha perso un po'' del suo smalto...', '7.5', 'Ni', '2020-06-13'),
(3, 1, 'Un film particolarmente toccante e Sean Penn fantastico.', '8.5', 'WOW', '2020-06-13'),
(2, 8, 'Una robaccia cos brutta non mi era capitata da moto tempo...', '3.0', 'Vorrei un rimborso, grazie.', '2020-06-13'),
(5, 8, 'Cosa dire... Sono rimasto sconvolto dalla pochezza della pellicola', '2.0', 'Statene alla larga', '2020-06-13'),
(6, 8, 'Nonostante gli avvertimenti dei miei amici mi sono recato al cinema ugualemnte per vederlo... Inutile dire che sono pi che pentito.', '4.0', 'Gli amici hanno sempre ragione', '2020-06-13'),
(8, 8, 'Ho dato una possibilit al film e niente ora sono depresso', '5.2', 'XANAX GRAZIE', '2020-06-13'),
(10, 2, 'Un film biografico davvero accurato, da studente di storia sono colpito della resa.', '8.5', 'I dettagli', '2020-06-13'),
(12, 2, 'Un film che non molti conoscono ma che molti dovrebbero apprezzare', '8.0', 'Bello', '2020-06-13'),
(14, 2, 'Forse leggermente lento nella parte centrale ma per il resto davvero toccante', '7.8', 'Un film non male', '2020-06-13'),
(16, 2, 'Il regista ha saputo davvero cogliere la sofferenza del periodo storico in cui  ambientato il film...', '8.3', 'Carino', '2020-06-13'),
(17, 2, 'Non ho nulla da dire film che parla da solo a tratti lento ma nel complesso racconta una storia che tutti dovrebbero conoscere', '7.5', 'Non male', '2020-06-13'),
(18, 3, 'Le sorelle Wachowski hanno diretto un piccolo capolavoro.', '7.7', 'Una perla', '2020-06-13'),
(20, 3, 'Non c''ho capito molto ma mi  piaciuto!', '8.9', 'Sono confuso ma felice', '2020-06-13'),
(21, 3, 'Mi aspettavo di pi ad essere onesto.', '7.2', 'Not good not bad', '2020-06-13'),
(6, 3, 'A molti non  piaciuto io invece sono soddisfatto del lavoro che hanno tirato fuori. Tom Hanks magistrale!', '8.0', 'E'' cos che si fa!', '2020-06-13'),
(13, 3, 'Non ho ben capito alcuni passaggi, forse dovrei riseguirlo con pi attenzione, anche se devo ammetere che  ben fatto.', '7.0', 'Ci sta!', '2020-06-13');
